import React from "react";
import MaterialTable from 'material-table';
function Table() {
    const data = [ {name:"kamalesh",age:24},
    {name:"magesh",age:24},
    {name:"nandy",age:21},
    {name:"vinmeetha",age:28} ]
    const columns = [
        {
            title:"Name",field:"name"
        },
        {
            title:"Age",field:"age"
        }
    ]
    
    return (
      <>
        <h1>table goes here</h1>
        <div style={{width:"50 vw"}}>
            <MaterialTable title="Material Table"
            data={data}
            columns={columns}
            options={{
                paging:false
            }}
            />
        </div>
      </>
    );
  }
  
  export default Table;
